import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";

const Spots = ({ spot }) => {
  return (
    <>
      {spot.map((spot) => (
        <Marker position={[spot.lat, spot.long]}>
          <Popup>
            Testing. <br /> testing x2
          </Popup>
        </Marker>
      ))}
    </>
  );
};

export default Spots;
